(102, 0, 428, 'a:2:{s:9:"oldRecord";a:4:{s:6:"header";s:7:"Test :)";s:4:"date";i:0;s:9:"subheader";s:0:"";s:8:"bodytext";s:0:"";}s:9:"newRecord";a:4:{s:6:"header";s:21:"Greifvögel in Hessen";s:4:"date";i:1551913200;s:9:"subheader";s:28:"Projekt im Kreis Gross-Gerau";s:8:"bodytext";s:278:"\r\n<p>Majestätisch gleiten sie durch die Lüfte. Ihr Körperbau macht sie zu perfekten Fliegern. Ihr Sehvermögern macht aus den Flugkünstlern bestechende Jäger. Anmut und Kraft der Greifvögel faszinieren die Menschen seit jeher. Aber Greifvögel haben nicht nur Freunde.</p>";}}', 'header,date,subheader,bodytext', 20, 'tt_content', 1551952181, NULL, 0);
