(310, 0, 1066, 'a:2:{s:9:"oldRecord";a:1:{s:8:"bodytext";s:416:"<p>Die Natur ist kein Streichelzoo. Vom putzigen Rotkehlchen bis zum majestätischen Rotmilan: Alle Vogelarten erbeuten andere Tiere und können selbst Beute werden. Uns ist das bewusst. Aber in Zeiten, in denen immer weniger Menschen Kontakt zur Natur haben und viele Arten am Rand des Aussterbens stehen, ist der Verlust eines, mitunter sorgsam gehegten Individuums für manche Zeitgenossen schwer zu ertragen.</p>";}s:9:"newRecord";a:1:{s:8:"bodytext";s:440:"<p>Die Natur ist kein Streichelzoo. Vom putzigen Rotkehlchen bis zum majestätischen Rotmilan: Alle Vogelarten erbeuten andere Tiere und können selbst Beute werden. Uns ist das bewusst. Aber in Zeiten, in denen immer weniger Menschen Kontakt zur Natur haben und viele Arten am Rand des Aussterbens stehen, ist der Verlust eines, mitunter sorgsam gehegten Individuums für manche Zeitgenossen schwer zu ertragen.</p>\r\n<p>t3://page?uid=3</p>";}}', 'bodytext', 22, 'tt_content', 1553250412, NULL, 0),
